export function log_in(email, password){
    console.log(email, senha);

    return{
        type:'ASYNC_LOG_IN',
        payload: {
            email,
            password
        }

    }
}

export function log_out(){
    return{
        type:'LOG_OUT',
        payload: false

    }
}
